import React from "react";
import styled from "styled-components";

//css section
const Wrapper = styled.div`
  display: grid;
  width: 100%;
  background-color: rgb(78, 77, 77);
  color: rgb(212, 201, 201);
  padding: 20px;
  row-gap: 10px;

  .footer-container .foot-item div {
    display: flex;
    align-items: center;
  }

  .footer-container .foot-item div img {
    height: 30px;
    width: 30px;
    border-radius: 50%;
    margin-right: 20px;
  }
  .footer-container .foot-item div span {
    font-size: 0.5rem;
    margin-right: 20px;
    margin-left: 5px;
  }
  .footer-container .foot-item {
    margin: 0;
    padding: 0;
  }
  ul {
    list-style-type: none;
    margin: 0;
    padding: 0;
    margin-top: 20px;
  }
  li {
    margin-bottom: 15px;
  }
  a {
    text-decoration: none;
    color: rgb(212, 201, 201);
  }
  a:hover {
    font-weight: bold;
    color: #fff;
  }
`;

function Footer() {
  return (
    <Wrapper class="footer-container">
      <div class="foot-item item1">
        <div>
          <img src="brand.png" alt="logo" />
          <h3 class="name">All Voice Blog</h3>
        </div>
        <ul>
          <li>
            <a href="index.html">Home</a>
          </li>
          <li>
            <a href="about.html">About</a>
          </li>
          <li>
            <a href="contact.html">Contact</a>
          </li>
        </ul>
      </div>

      <div class="foot-item item2">
        <h4>Follow All Voice</h4>
        <div class="footimg-container"></div>
      </div>
      <p class="foot-item item3">
        <em>Copyright at Idoko</em>
      </p>
    </Wrapper>
  );
}

export default Footer;
